module.exports = exports = function (i, params, result) {
    model = i.model;
    var schemaList = [];
    model.where('level').gte(params.level).find(function (err, obj) {
        if (err || (obj === undefined)) {
            result(null, []);
        } else {
            obj.forEach(function (i) {
                schemaList.push(i.name);
            });
            result(null, schemaList);
        }
    });
};